import React from 'react';
import { Col } from 'reactstrap';

class BruiloftenMenuItem extends React.Component{
    render(){
        return (
            <Col sm="10">
                <BruiloftenMenuItem/>
            </Col>
          );
    }
};

export default BruiloftenMenuItem;
